package ManishLokesh.Neptune.v2.Orders.ResponseBody;public class OrderAmountResponse {    private String paymentType;    private Double totalAmount;    private Double gst;    private Double deliveryCharge;    private Double payable_amount;    @Override    public String toString() {        return "OrderAmountResponse{" +                "paymentType='" + paymentType + '\'' +                ", totalAmount=" + totalAmount +                ", gst=" + gst +                ", deliveryCharge=" + deliveryCharge +                ", payable_amount=" + payable_amount +                '}';    }    public String getPaymentType() {        return paymentType;    }    public void setPaymentType(String paymentType) {        this.paymentType = paymentType;    }    public Double getTotalAmount() {        return totalAmount;    }    public void setTotalAmount(Double totalAmount) {        this.totalAmount = totalAmount;    }    public Double getGst() {        return gst;    }    public void setGst(Double gst) {        this.gst = gst;    }    public Double getDeliveryCharge() {        return deliveryCharge;    }    public void setDeliveryCharge(Double deliveryCharge) {        this.deliveryCharge = deliveryCharge;    }    public Double getPayable_amount() {        return payable_amount;    }    public void setPayable_amount(Double payable_amount) {        this.payable_amount = payable_amount;    }}